import './App.css';
function App() {

  return (
    <div>
      <h1 className="Head">To Do List</h1>

      <div className="input">
        <input type="text" placeholder="Enter The Task"></input>
        <button>+</button>
      </div>
     <center>
       <div className="add">
        <div className="todo">
          <p>Learn New Things</p>
          <input type="checkbox"></input>
          <button>Delete</button>
        </div>
       </div>
       </center>
    </div>
  );
}

export default App;
